import React from 'react';
import {Row, Col} from "reactstrap";

const Footer = () => {
    const thisYear = () => {
        const year = new Date().getFullYear();
        return year
    };

    return (
        <div>
            <Row>
                <Col>
                    <p>
                        Copyright &copy; <span>{thisYear()}</span>

                    </p>
                </Col>
            </Row>
        </div>
    )
};

export default Footer;
